import './App.css';

function App() {
  return (
    <div className="App">
      <div className="Addpass">
          <input type="text" placeholder="Ex. pass 12345" />
          <input type="text" placeholder="Ex. Facebook" />
          <button> Add Password</button>
      </div>
    </div>
  );
}

export default App;
